type Actions = { type: "default"};

interface initState {
    collections: [];
    current: string;
    open: boolean;
};

type State = initState;


const collectionsReducer = (state: State , action:Actions) => {
    switch(action.type) {
        default:
            return state
    }
}

export default collectionsReducer
